(4, 'Quia praesentium quod esse esse esse.', 'Eaque quia porro et id. Molestias quibusdam laudantium quia iusto odio. Quia labore velit modi et.', 'Incidunt voluptatum commodi quaerat qui doloremque nihil impedit quisquam. Saepe sunt facilis consectetur illo. Nihil ad recusandae alias quae blanditiis.', 0, 1, 3, 7, 'assumenda cumque laborum', 0, '2023-10-07 19:39:11', '2023-10-07 19:39:11'),
